import React from "react";

const SPChart = () => {
    return (
        <div>
            <h2>S&P 500 실시간 차트</h2>
            <div className="tradingview-widget-container">
                <iframe
                    src="https://s.tradingview.com/embed-widget/mini-symbol-overview/?symbol=SP%3ASPX&locale=kr"
                    width="100%"
                    height="400"
                    frameBorder="0"
                    allowTransparency="true"
                    scrolling="no"
                ></iframe>
            </div>
        </div>
    );
};

export default SPChart;
